CREATE DATABASE game_data;

CREATE TABLE game_data.videogames (
    id INT NOT NULL AUTO_INCREMENT,
    game_rank Int,
    name VARCHAR(255) NOT NULL,
    platform VARCHAR(255),
    year Int,
    genre varchar(255),
    publisher varchar(255),
    northamericasales DOUBLE,
    europesales DOUBLE,
    japansales DOUBLE,
    othersales DOUBLE,
    globalsales DOUBLE,
    primary key(id)
);


